import { Navbar } from "../../component/Navbar";

import styled from "@emotion/styled";
import SignUp from "./SignUp";
import SignIn from "./SignIn";

const Container = styled.div`
  width: 850 px;
  display: flex;
  justify-content: space-between;
  margin: 30px 80px;
`;

export const RegisterPage = () => {
  return (
    <div>
      <Navbar />
      <Container>
        <SignUp />
        <SignIn />
      </Container>
    </div>
  );
};
